import React from "react";
import { Tile } from "../tile/Tile";

export const TileList = () => {
  return (
    <div>
      {(array) => array.map(({ name, ...rest }, index) => {
        let description = {...rest};
        
        return <Tile 
        name={name}
        key={index}
        description={description} />
      })}
    </div>
  );
};
